document.getElementById('rainbowRoad').onclick = seeRainbow
document.getElementById('mooMoo').onclick = seeMoo
document.getElementById('waluigiPinball').onclick = seeWal
document.getElementById('peachBeach').onclick = seePeach
document.getElementById('delfinoSquare').onclick = seeDelfino
document.getElementById("koopaCape").onclick = seeKoopa
document.getElementById('maple').onclick = seeMaple
document.getElementById('coconut').onclick = seeCoconut


function seeRainbow() {
  document.getElementById('title').innerText = "Rainbow Road"
  document.getElementById('look').style.backgroundImage = "url(images/rainbow.jfif)"
  document.getElementById('info').innerText = "Presented as a rainbow-coloured racing course suspended in space, Rainbow Road is widely recognized as one of the most iconic elements of the Mario Kart series. First appearance: Super Mario Kart (SNES)"
}

function seeMoo() {
    document.getElementById('title').innerText = "Moo Moo Meadows"
    document.getElementById('look').style.backgroundImage = "url(https://mario.wiki.gallery/images/thumb/f/f4/Moo_Moo_Meadows_MKWii.png/300px-Moo_Moo_Meadows_MKWii.png)"
    document.getElementById('info').innerText = "This course was inspired by the Moo Moo Farm course from Mario Kart 64 and has been featured in Mario Kart Wii and Mario Kart 8 for the WiiU and Switch."
  }

function seeWal() {
document.getElementById('title').innerText = "Waluigi Pinball"
document.getElementById('look').style.backgroundImage = "url(https://mario.wiki.gallery/images/2/2d/Waluigi_Pinball.png)"
document.getElementById('info').innerText = "As its name implies, this course takes place in a giant pinball machine themed after Waluigi and contains many sharp turns and curves. This course first appeared in Mario Kart DS and has re-appeared in Mario Kart 7, Mario Kart Tour, and Mario Kart 8 - Deluxe as a DLC course."
}

function seePeach() {
document.getElementById('title').innerText = "Peach Beach"
document.getElementById('look').style.backgroundImage = "url(data:image/jpeg;base64,)"
document.getElementById('info').innerText = "First Appeared in Mario Kart Double Dash on the Nintendo Gamecube. It is reminiscent of Gelato Beach and other areas from Super Mario Sunshine which appeared on the same console."
}

function seeDelfino() {
document.getElementById('title').innerText = "Delfino Square"
document.getElementById('look').style.backgroundImage = "url(https://mario.wiki.gallery/images/0/03/DelfinosquareDS.png)"
document.getElementById('info').innerText = "First appeared on Mario Kart DS but also appeared on Mario Kart Wii. This race takes place in part of the plaza and pier. The major feature of the track is the drawbridge near the end of the course that rises and lowers during the race."
}

function seeKoopa() {
document.getElementById('title').innerText = "Koopa Cape"
document.getElementById('look').style.backgroundImage = "url(data:image/jpeg;base64,)"
document.getElementById('info').innerText = "First appeared in Mario Kart Wii. The course takes place on an isle of sort where racers begin the race next to a cliff. The isle also contains a river cutting through a forrest and an underwater tunnel for racers to dive into!"
}


function seeMaple() {
document.getElementById('title').innerText = "Maple Treeway"
document.getElementById('look').style.backgroundImage = "url(https://mario.wiki.gallery/images/thumb/e/e9/MKW_Maple_Treeway_Overlook.png/300px-MKW_Maple_Treeway_Overlook.png)"
document.getElementById('info').innerText = "First appeared in Mario Kart Wii but also appeared in Mario Kart 7 and Mario Kart Tour. The track consists of racing on tree branches, on the treetops, and even within the trees themselves. The music used for Maple Treeway is also used for Bowser's Castle(it's just slower and lower pitched)!"
}

function seeCoconut() {
document.getElementById('title').innerText = "Coconut Mall"
document.getElementById('look').style.backgroundImage = "url(https://mario.wiki.gallery/images/thumb/7/7d/Coconut_Mall_MKWii.png/300px-Coconut_Mall_MKWii.png)"
document.getElementById('info').innerText = "First appeared in Mario Kart Wii and later in Mario Kart 7 and Mario Kart 8 Deluxe as a DLC course. The race is set in a shopping center which, according to the official Game Guide, is said to be located on Isle Delfino (the same island from Mario Party Sunshine)!"
}



